import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const DashboardActions = () => {
  return (
    <Fragment>
      <div className='dash-buttons'>
        <Link to='/edit-profile' className='btn btn-primary'>
          <i className='fas fa-user-circle text-light'></i> Profile
        </Link>

        <Link to='/add-experience' className='btn btn-primary'>
          <i className='fab fa-black-tie text-light'></i> Trainings/Experience
        </Link>
        <Link to='/add-education' className='btn btn-primary'>
          <i className='fas fa-graduation-cap text-light'></i> Education
        </Link>
      </div>
    </Fragment>
  );
};

export default DashboardActions;
